import React, { useEffect, useState } from "react";
import { StyleSheet, View, Text, TextInput, Button, As } from "react-native";
import { Formik } from "formik";
import * as yup from "yup";
import { RadioButton } from "react-native-paper";
import axios from "axios";
const ReviewSchema = yup.object({
  phonenumber: yup.string().required().min(2).max(10),
});
export default function Register({ navigation }) {
  // output value
  const [registerData, setregisterData] = useState({
    phone: "",
    typeofuser: 1,
  });
  const [value, setValue] = React.useState(1);

  const onSubmitHandler =async (val) => {
    console.log(val.phonenumber, " -------  ", value);

    const params = JSON.stringify({
      phone_number: val.phonenumber,
    });

    let axiosConfig = {
      headers: {
        "Content-Type": "application/json;charset=UTF-8",
      },
    };



    const response = await axios.post('http://192.168.1.7:8000/sendotp/', params,axiosConfig);
        console.log(response);
    console.log("chechk update----->", registerData);
    navigation.push("Otp", value);
  };

  const loginpage = () => {
    navigation.push("Login");
  };

  return (
    <View>
      <View>
        <RadioButton.Group
          onValueChange={(newValue) => setValue(newValue)}
          value={value}
        >
          <View style={styles.radio}>
            <View style={styles.radio1}>
              <RadioButton title="scasc1" value={1} />
              <Text>I'm looking for a chef</Text>
            </View>
            <View style={styles.radio1}>
              <RadioButton value={2} />
              <Text>I'm a chief</Text>
            </View>
          </View>
        </RadioButton.Group>
      </View>
      <Formik
        initialValues={{ phonenumber: "" }}
        validationSchema={ReviewSchema}
        onSubmit={(values, actions) => {
          // addreview(values);
          console.log("----/////----", values, "----//", value);
          actions.resetForm();
        }}
      >
        {(props) => (
          <View>
            <TextInput
              placeholder="Enter Mobile Number"
              value={props.values.phonenumber}
              onChangeText={props.handleChange("phonenumber")}
            />
            <Text>{props.touched.title && props.errors.title}</Text>
            <Button
              title="REGISTER"
              onPress={() => {
                props.handleSubmit();
                onSubmitHandler(props.values);
              }}
            />
          </View>
        )}
      </Formik>
      <Button title="already registered proceed to login" onPress={loginpage} />
    </View>
  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  radio: {
    flexDirection: "row",
  },
  radio1: {
    flexDirection: "row",
  },
});
